import React, { Component } from 'react';

class WorkOrders extends Component{
    constructor(props){
        super(props);
        this.state = {
            workorders : []
        }
    }

    componentDidMount(){
        this.getWorkorders();
    }

    getWorkorders(){
        fetch('http://localhost:4006/Workorders')
        .then(res => res.json())
        .then(workorders => this.setState({workorders}))
    }

    render(){
        const {workorders} = this.state
        return(
            <div>
                {workorders.length ? (
                    <div>
                        {workorders.map ((item)=>{
                            return(
                            <p>{item.w_status}</p>
                            )
                        })}
                    </div>
                ):(<div>
                    Loading ....
                    </div>) }
            </div>
        )
    }
}

export default WorkOrders;
